INSERT INTO `fj_article` VALUES ('1', '3', '4', null, '第一篇文章22', 'admin', '<img src=\"/uploads/20160920/84ea0c4404-qq-tu-pian20150811162751.jpg\"><img src=\"/uploads/20160920/181571ac98-bi-zhi20130703160812.jpg\"><p> ERS平台\r\n</p><p> 乐换新,手机零售互联网+革新者!商家ERS系统平台由乐换新精英团队自主开发而成，为商家提供线上线下一体的手机销售电商平台。从批发进货到库存管理、 销售出库的完整解决方案。系统创造性的将企业批发代理与系统进行整合，便于各类型企业开展业务；同时融入企业内部门店管理、货品调拨与零售门店收银结账等 内容，为企业提供完备的批发零售经营解决方案。\r\n</p><p> 商家ERS系统平台通过整合资源，构建集物流、商流、信息流三位一体的供应链服务平台，为商家实现供应链管理的优化，帮助商家提升效益，推动商家管理创新！\r\n</p><p><img src=\"/uploads/1/08425b881b-20122760664006.jpg\" alt=\"08425b881b-20122760664006\"></p><p> 平台优势\r\n</p><p><img src=\"/uploads/1/9713faa264-1.jpg\"></p><p> 行业领先，产品团队成员行业理解深刻，多年手机行业经验汇入平台\r\n</p><p> 平台专业，多年系统开发经验，功能和界面更贴近用户，更好体验\r\n</p><p> 大数据+，发现更多商家，客户需求精准\r\n</p><p> 在线管理，运营状况透明，管理更省心\r\n</p><p> 线上服务，线下体验更靠谱\r\n</p><p><img style=\"width: 103px; height: 159px;\" src=\"/uploads/1/e6d8545daa-20122289055155.jpg\" height=\"159\" width=\"103\">\r\n</p><p> 乐易云商平台可为商家提供多平台多店铺管理、商品管理、订单处理、采购、库存、发货、售后、财务管理以及会员管理、报表推送等各类数据服务，实现订单流、信息流完美闭环。拥有卓越的稳定性，扩展性和安全性！\r\n</p><p> 总店配货、门店调货，库存管理更灵活；\r\n</p><p> 支持用户线上购买，门店提货，尽享便捷服务；\r\n</p>', '1', '55', null, '1472013958');
