-- Table structure for fj_card_order_payback
-- ----------------------------
DROP TABLE IF EXISTS `fj_card_order_payback`;
CREATE TABLE `fj_card_order_payback` (
  `pay_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `pay_sn` varchar(20) NOT NULL COMMENT '回款单号',
  `pay_status` tinyint(4) DEFAULT '0' COMMENT '0 默认 待回款\r\n2 部分回款\r\n3 回款完成\r\n4 取消',
  `apply_type` tinyint(4) unsigned DEFAULT '3' COMMENT '商家申领付款类型\r\n\r\n0 后付款\r\n2 部分付款\r\n3 全款  默认',
  `handle_type` tinyint(4) unsigned DEFAULT '0' COMMENT '0 商家直接发放卡券\r\n1 申领然后发放卡券',
  `from_seller_id` int(10) unsigned NOT NULL COMMENT '发放人（乐换新 或一级商家）',
  `to_seller_id` int(10) NOT NULL DEFAULT '0' COMMENT '接受商家  （一级 或二级商家）',
  `num` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '卡券数量',
  `total_price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '卡券总价',
  `send_total_price` decimal(10,2) unsigned DEFAULT '0.00' COMMENT '已发放卡券总价',
  `received_price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '实收款',
  `back_price` decimal(10,2) DEFAULT '0.00' COMMENT '应退总价',
  `real_back_price` decimal(10,2) unsigned DEFAULT '0.00' COMMENT '实际退款总价',
  `add_time` int(10) NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`pay_id`),
  UNIQUE KEY `pay_sn` (`pay_sn`)
) ENGINE=InnoDB AUTO_INCREMENT=135 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='卡券发放与退款 财务表';

