  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `pay_sn` varchar(20) NOT NULL COMMENT '发放批次',
  `coverage_code` varchar(200) NOT NULL DEFAULT '' COMMENT '险种',
  `card_numbers` text NOT NULL COMMENT '卡券字符串以逗号隔开',
