  `back_price` decimal(10,2) DEFAULT '0.00' COMMENT '所在险种应退金额',
  `real_back_price` decimal(10,2) DEFAULT '0.00' COMMENT '所在险种实际退款',
  `from_seller_id` int(10) NOT NULL,
  `to_seller_id` int(10) NOT NULL,
