  KEY `status` (`status`),
  KEY `from_seller_id` (`from_seller_id`),
  KEY `to_seller_id` (`to_seller_id`),
  KEY `pay_sn` (`pay_sn`)
) ENGINE=InnoDB AUTO_INCREMENT=38 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='卡券退货退款表处理 处理中的卡券被冻结不能使用 ';

