  `period` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '保险周期',
  `cost_price` decimal(10,2) DEFAULT '0.00' COMMENT '成本价',
  `official_price` decimal(10,2) DEFAULT '0.00' COMMENT '官方价',
  `wholesale_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '批发价',
  `max_payment` decimal(10,2) DEFAULT '0.00' COMMENT '最高赔付',
  `coverage_code` varchar(40) NOT NULL COMMENT '保险险种码',
  `status` tinyint(4) DEFAULT '0' COMMENT '0 冻结 1 激活',
  `is_more` tinyint(4) unsigned NOT NULL DEFAULT '0' COMMENT '是否允许多次维修 1 是 0 否',
  `image` varchar(200) NOT NULL DEFAULT '' COMMENT '保险图片',
  `add_time` int(10) unsigned NOT NULL DEFAULT '0',
  `note` text NOT NULL COMMENT '保险说明',
  PRIMARY KEY (`id`),
  UNIQUE KEY `coverage_code` (`coverage_code`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='保险险种信息';

