-- ----------------------------
-- Table structure for fj_order
-- ----------------------------
DROP TABLE IF EXISTS `fj_order`;
CREATE TABLE `fj_order` (
  `order_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '虚拟订单索引id',
  `order_sn` varchar(50) NOT NULL COMMENT '订单编号',
  `member_id` int(10) unsigned NOT NULL COMMENT '买家id',
  `member_name` varchar(50) NOT NULL DEFAULT '' COMMENT '买家姓名',
  `member_phone` char(11) NOT NULL COMMENT '买家手机',
  `payment_code` char(10) DEFAULT '' COMMENT '支付方式名称代码     kaquan',
  `pay_sn` varchar(50) NOT NULL DEFAULT '' COMMENT '支付编号',
  `payment_time` int(10) unsigned DEFAULT '0' COMMENT '支付(付款)时间',
  `order_amount` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '订单总价格(支付金额)',
  `order_state` tinyint(4) NOT NULL DEFAULT '0' COMMENT '订单状态：0(已取消)10(默认):未付款;20:已付款;30:保障中40:已完成;60:申请退款;70:退款成功; 80:退保,21:待审核（已提交资料），22:审核成功，23:审核失败',
  `coverage_id` int(10) unsigned DEFAULT '0',
  `coverage_code` varchar(40) DEFAULT NULL COMMENT '保险险种',
  `coverage_name` varchar(200) DEFAULT NULL,
  `coverage_type` int(10) unsigned DEFAULT '0',
  `coverage_price` decimal(10,2) DEFAULT '0.00' COMMENT '保险购买价格',
  `is_delay` tinyint(4) DEFAULT '0' COMMENT '是否为延保 0 否 1 普通延保 2 延保＋整机  3  延保＋碎屏',
  `number` int(10) unsigned DEFAULT '1',
  `is_pre_vest_order` tinyint(4) DEFAULT '0' COMMENT '是否是预投保订单',
  `buyer_msg` varchar(200) DEFAULT NULL COMMENT '买家留言',
  `order_type` tinyint(4) DEFAULT '0' COMMENT '0普通零售 1批发 ',
  `order_from` tinyint(4) DEFAULT '1' COMMENT '1WEB2mobile',
  `add_time` int(10) unsigned NOT NULL COMMENT '订单生成时间',
  PRIMARY KEY (`order_id`),
  KEY `add_time` (`add_time`)
) ENGINE=InnoDB AUTO_INCREMENT=1898 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

-- ----------------------------
-- Records of fj_order
-- ----------------------------

