  `idcrad` varchar(20) DEFAULT '' COMMENT '身份证号码',
  `buy_date` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '购机时间',
  `invo_image` varchar(255) DEFAULT '' COMMENT '发票地址',
  `imei_face_image` varchar(255) DEFAULT '' COMMENT 'imei 正面图',
  `imei_back_image` varchar(255) DEFAULT '' COMMENT 'imei 背面',
  `brand_id` int(10) unsigned DEFAULT '0' COMMENT '品牌ID',
  `model_id` int(10) unsigned DEFAULT '0' COMMENT '机型ID',
  `color_id` int(10) unsigned DEFAULT '0' COMMENT '颜色ID',
  `is_data` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否提交资料',
