  `yiwai_end_time` int(11) DEFAULT '0' COMMENT '延保复合  意外保障时间',
  `policy_number` varchar(50) DEFAULT '' COMMENT '投保保单号',
  `surplus_value` decimal(10,2) DEFAULT '0.00' COMMENT '保单剩余价值',
  `server_mark` varchar(500) DEFAULT '' COMMENT '客服备注',
