-- ----------------------------
-- Table structure for fj_order_maintenance
-- ----------------------------
DROP TABLE IF EXISTS `fj_order_maintenance`;
CREATE TABLE `fj_order_maintenance` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `member_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '维保发起人',
  `order_id` int(10) NOT NULL COMMENT '保险订单id',
  `order_sn` varchar(50) NOT NULL DEFAULT '' COMMENT '保险订单号',
  `type` tinyint(4) NOT NULL DEFAULT '1' COMMENT '维修方式 1上门 2到店 3邮寄',
  `express_id` int(10) DEFAULT '0' COMMENT '快运公司',
  `express_number` varchar(40) NOT NULL DEFAULT '' COMMENT '快递单号',
  `contact` varchar(50) NOT NULL COMMENT '联系人',
  `contact_number` varchar(255) NOT NULL COMMENT '联系电话',
  `province_id` int(10) unsigned NOT NULL COMMENT '所在省id',
  `city_id` int(10) unsigned NOT NULL COMMENT '城市id',
  `area_id` int(10) unsigned NOT NULL COMMENT '区域id',
  `address` varchar(255) NOT NULL COMMENT '服务地址',
  `state` tinyint(4) NOT NULL DEFAULT '1' COMMENT '状态\r\n0 失败--审核失败  \r\n1 提交理赔--待审核\r\n2审核--待指派\r\n3指派人员--服务中\r\n4服务中--待提交理赔资料\r\n5维保完成\r\n\r\n ',
  `verify_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '订单审核时间',
  `is_finish` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否最终完成 1 or 0',
  `mark` varchar(255) NOT NULL COMMENT '客户备注',
  `add_time` int(11) unsigned DEFAULT '0',
  `before_time` varchar(255) NOT NULL DEFAULT '',
  `appointment_date` varchar(50) DEFAULT '' COMMENT '预约日期',
  `appointment_time` varchar(50) DEFAULT '' COMMENT '预约时间',
  `real_appointment_time` varchar(255) NOT NULL DEFAULT '' COMMENT '确认修改时间',
  `edit_num` tinyint(2) NOT NULL DEFAULT '0' COMMENT '修改次数',
  `phone_img` varchar(255) NOT NULL DEFAULT '' COMMENT '碎屏照片',
  `back_img` varchar(255) DEFAULT '' COMMENT '手机背面图',
  `id_back_img` varchar(255) DEFAULT '' COMMENT '身份证背面图',
  `id_face_img` varchar(255) DEFAULT '' COMMENT '身份证正面图',
  `info` varchar(500) NOT NULL DEFAULT '' COMMENT '失败原因',
  PRIMARY KEY (`id`),
  KEY `vr_order_id` (`order_id`),
  KEY `type` (`type`)
) ENGINE=InnoDB AUTO_INCREMENT=442 DEFAULT CHARSET=utf8 COMMENT='维保提交信息记录表（客户申请维保）';

