  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '保险订单',
  `order_sn` varchar(50) NOT NULL COMMENT '保险订单号',
  `m_order_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '维修订单号',
  `m_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '商家ID',
  `delivery_note` varchar(300) NOT NULL DEFAULT '' COMMENT '指派留言',
  `manager_note` varchar(255) NOT NULL DEFAULT '',
  `service_status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '服务状态  1 待上门   3 维修失败  4 服务中待提交资料 5  审核中  6  审核失败  7 核查完成 \r\n0 废弃无用',
  `service_examine_time` int(11) unsigned DEFAULT '0' COMMENT '服务审核时间 ，成功或失败',
  `vertify_img` text NOT NULL COMMENT '维修资料',
  `vertify_result` varchar(255) NOT NULL COMMENT '维修备注',
  `damage_type` tinyint(4) unsigned NOT NULL DEFAULT '0' COMMENT '屏幕损坏 1 内屏 2 外屏  3内外屏',
  `inner_price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '商家内屏幕报价',
  `outer_price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '外屏报价',
  `expenses` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '收取费用比例',
  `total_price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '总价格',
  `repair_ok_time` int(10) unsigned DEFAULT '0' COMMENT '维修完成时间',
  `server_mark` varchar(100) DEFAULT '' COMMENT '客服备注',
  `add_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`),
  KEY `order_id` (`order_id`),
  KEY `m_order_id` (`m_order_id`),
  KEY `m_id` (`m_id`),
  KEY `service_status` (`service_status`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8 COMMENT='商家维修表';

