-- Table structure for fj_role_nav_group
-- ----------------------------
DROP TABLE IF EXISTS `fj_role_nav_group`;
CREATE TABLE `fj_role_nav_group` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(30) NOT NULL COMMENT '大类菜单名字',
  `icons` varchar(30) DEFAULT NULL,
  `is_effect` tinyint(1) NOT NULL,
  `sort` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `is_effect` (`is_effect`),
  KEY `sort` (`sort`)
) ENGINE=InnoDB AUTO_INCREMENT=26 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='菜单导航分组';

