-- ----------------------------
-- Table structure for fj_seller
-- ----------------------------
DROP TABLE IF EXISTS `fj_seller`;
CREATE TABLE `fj_seller` (
  `seller_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '卖家编号',
  `seller_name` varchar(50) NOT NULL COMMENT '卖家用户名',
  `member_id` int(10) unsigned NOT NULL COMMENT '用户编号',
  `is_insurance` tinyint(1) unsigned DEFAULT '0' COMMENT '是否为保险商户 1 是 0 否',
  `is_repair` tinyint(1) unsigned DEFAULT '0' COMMENT '是否为维修商户 1 是 0 否',
  `pid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '父id',
  `province_id` int(10) unsigned DEFAULT '0' COMMENT '商家所在省',
  `city_id` int(10) unsigned DEFAULT '0' COMMENT '市id',
  `area_id` int(10) unsigned DEFAULT '0' COMMENT '地区id',
  `area_info` varchar(100) DEFAULT '' COMMENT '省市地区冗余数据 eg xx省 xx市 xx区 空格分隔',
  `detail_address` varchar(100) DEFAULT '' COMMENT '详细地址',
  `concat` varchar(50) DEFAULT '' COMMENT '联系人',
  `concat_tel` char(11) DEFAULT '' COMMENT '联系电话',
  `status` tinyint(4) unsigned DEFAULT '1' COMMENT '状态 1 启用 0 否',
  `add_time` int(10) NOT NULL DEFAULT '0' COMMENT '保存时间戳',
  `is_agreement` tinyint(4) DEFAULT '0' COMMENT '0 默认 否   1 是',
  PRIMARY KEY (`seller_id`),
  KEY `member_id` (`member_id`),
  KEY `status` (`status`),
  KEY `is_insurance` (`is_insurance`),
  KEY `is_main` (`is_repair`)
) ENGINE=InnoDB AUTO_INCREMENT=28 DEFAULT CHARSET=utf8 COMMENT='商家表';

-- ----------------------------
-- Records of fj_seller
-- ----------------------------

-- ----------------------------
-- Table structure for fj_seller_settle
-- ----------------------------
DROP TABLE IF EXISTS `fj_seller_settle`;
CREATE TABLE `fj_seller_settle` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `m_order_id` int(10) DEFAULT NULL COMMENT '维保订单号',
  `seller_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '商家ID',
  `price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '结算金额',
  `expenses` tinyint(4) unsigned DEFAULT NULL COMMENT '平台服务费 比例',
  `status` tinyint(2) unsigned NOT NULL DEFAULT '1' COMMENT '是否结算 0 结算中（提现中），1 否（默认值，待申请提现）  ，2 结算成功 ,3 结算失败',
  `settle_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '待结算时间，默认为订单完成后15天',
  `add_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '订单完成时间',
  `finsh_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '商家结算完成时间',
  PRIMARY KEY (`id`),
  KEY `seller_id` (`seller_id`) USING BTREE,
  KEY `status` (`status`),
  KEY `settle_time` (`settle_time`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8 COMMENT='商家结算金额表';

-- ----------------------------
-- Records of fj_seller_settle
-- ----------------------------

-- ----------------------------
-- Table structure for fj_seller_settle_log
-- ----------------------------
DROP TABLE IF EXISTS `fj_seller_settle_log`;
CREATE TABLE `fj_seller_settle_log` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `m_order_id` int(10) unsigned NOT NULL,
  `seller_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '商家ID',
  `price` decimal(10,0) unsigned NOT NULL DEFAULT '0' COMMENT '结算金额',
  `content` varchar(255) NOT NULL DEFAULT '' COMMENT '日志内容',
  `uid` int(10) NOT NULL DEFAULT '0' COMMENT '操作人ID',
  `name` varchar(50) NOT NULL DEFAULT '' COMMENT '操作人名称',
  `add_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '添加时间',
  PRIMARY KEY (`id`),
  KEY `seller_id` (`seller_id`)
) ENGINE=InnoDB AUTO_INCREMENT=56 DEFAULT CHARSET=utf8 COMMENT='商家结算日志表';

-- ----------------------------
-- Records of fj_seller_settle_log
-- ----------------------------

-- ----------------------------
-- Table structure for fj_seller_statistics
-- ----------------------------
DROP TABLE IF EXISTS `fj_seller_statistics`;
CREATE TABLE `fj_seller_statistics` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `seller_id` int(10) unsigned NOT NULL COMMENT '卖家编号',
  `card_num` mediumint(6) DEFAULT '0' COMMENT '卡券总量',
  `active_num` mediumint(6) DEFAULT '0' COMMENT '激活数量',
  `settle_num` mediumint(6) DEFAULT '0' COMMENT '理赔数量',
  `lsoe_num` mediumint(8) unsigned DEFAULT '0' COMMENT '失效数量',
  `frost_num` mediumint(8) unsigned DEFAULT '0' COMMENT '冻结数量',
  `wait_num` mediumint(8) unsigned DEFAULT '0' COMMENT '未激活卡券',
  `add_time` int(10) DEFAULT '0' COMMENT '保存时间戳',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=76 DEFAULT CHARSET=utf8 COMMENT='商家统计表';

-- ----------------------------
-- Records of fj_seller_statistics
-- ----------------------------

