DROP TABLE IF EXISTS `fj_sms_log`;
CREATE TABLE `fj_sms_log` (
  `log_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `type` varchar(40) NOT NULL DEFAULT '' COMMENT '消息类型',
  `phone` char(11) NOT NULL,
  `captcha` varchar(10) DEFAULT NULL COMMENT '请求的动态验证嘛 如果有的话',
  `content` text NOT NULL,
  `agent` text NOT NULL COMMENT '代理',
  `ip` varchar(15) NOT NULL DEFAULT '' COMMENT 'ip 记录',
  `send_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' ON UPDATE CURRENT_TIMESTAMP COMMENT '消息加入队列时间 ',
  PRIMARY KEY (`log_id`)
) ENGINE=InnoDB AUTO_INCREMENT=84 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

