DROP TABLE IF EXISTS `fj_wx_member`;
CREATE TABLE `fj_wx_member` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `member_id` int(10) unsigned DEFAULT '0' COMMENT '用户ID',
  `openid` varchar(50) NOT NULL DEFAULT '' COMMENT '微信openid',
  `unionid` varchar(50) DEFAULT '',
  `nickname` varchar(50) NOT NULL DEFAULT '' COMMENT '微信昵称',
  `city` varchar(20) DEFAULT '' COMMENT '城市',
  `province` varchar(20) DEFAULT '' COMMENT '省份',
  `headimgurl` varchar(300) DEFAULT '' COMMENT '头像地址',
  `token` varchar(50) NOT NULL DEFAULT '',
  `client_type` varchar(10) NOT NULL DEFAULT '' COMMENT '客户端类型 android ios m weixin',
  `datetime` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' ON UPDATE CURRENT_TIMESTAMP COMMENT '登录时间',
  PRIMARY KEY (`id`),
